import React, {Component} from 'react'
import PhoneForm from './components/PhoneForm'

class App extends Component {
  state = {
    name: ''
  }
  handleChange = (e) => {
    this.setState({
      name: e.target.value
    })
  }
  render() {
    return (
      <div>
        <PhoneForm />
      </div>
    )
  }
}

export default App
